package com.example.stresstest.benchmark.cpu;import android.util.Log;import com.example.stresstest.benchmark.IBenchmark;public class CPUBenchmark implements IBenchmark {    private FloatingPointMathCPUBenchmark floatBench = new FloatingPointMathCPUBenchmark();    private IntegerMathCPUBenchmark intBench = new IntegerMathCPUBenchmark();    private PiDigitsCPUBenchmark piBench = new PiDigitsCPUBenchmark();    @Override    public void initialize() {        floatBench.initialize();        intBench.initialize();        piBench.initialize();    }    @Override    public void initialize(Long size) {    }    @Override    public void warmup() {    }    @Override    public void run() {        Log.d("CPUBench","Starting IntegerBenchmark");        intBench.run();        Log.d("CPUBench","Starting FloatBenchmark");        floatBench.run();        Log.d("CPUBench","Starting PIBenchmark");        piBench.run();        Log.d("CPUBench","All benchmarks finished");    }    @Override    public void stop() {        intBench.stop();        floatBench.stop();        piBench.stop();    }    @Override    public void clean() {    }    @Override    public void compute() {    }}